// Create 'li' element for a new score.
const createGameScore = (name, score) => {
  const li = document.createElement('li');
  li.textContent = `${name}: ${score}`;
  return li;
};

// add a score into the api
const addGameScore = async(apiUrl) => {
  const form = document.querySelector('form');
  await fetch(apiUrl, {
    method: 'POST',
    header: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      user: form.elements.name.value,
      score: form.elements.score.value,
    }),
  });
  form.reset();
};

// Get all game scores from the leaderboard api
const displayScores = async (apiUrl) => {
  const response = await fetch(apiUrl);
  const data = await response.json();
  scores = data.result;
  const scoresList = document.getElementById('scoreList');
  scoresList.innerHTML = '';
  scores.forEach((score) => {
    const li = createGameScore(score.user, score.score);
    scoresList.appendChild(li);
  });
};

